// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract ethswap{
    address public owner;
    mapping(address=>uint) balanceof;
    uint public utokens=1000000; // 1 million Tokens
    
 constructor(){
     owner = payable(msg.sender);
 }   
    
function balance()public view returns(uint){
return address(this).balance;
}

function getBalanceOf(address adr)public view returns(uint){
return balanceof[adr];
}

function purchase(address adr,uint amount)public returns(bool){
    if(amount<=utokens){

        utokens=utokens-amount;
        balanceof[adr]=balanceof[adr]+amount;
        return true;
    }
    else{
    revert("Not enough Tokens");
//    return false;
    }

}
//  1000000000000000000
function refund(address adr,uint256 amount)public payable{
  uint256 oneUToken=1000000000000000;//wei
  uint256 totalAmount=oneUToken*amount;
  if(balanceof[adr]>=amount){
  balanceof[adr]-=amount;
  payable(adr).transfer(totalAmount);
  }
  else{
      revert("User Do not have Tokens to refund");
  }

}

function fundMe()external payable { }

}
